import React, { useEffect, useState } from 'react';
import { View, Text, FlatList, StyleSheet, Image, TouchableOpacity } from 'react-native';
import Icon from 'react-native-vector-icons/MaterialIcons';
import { ImagebaseURL } from '../../helpers/axios';
import { useDispatch, useSelector } from 'react-redux';
import MyDialog from '../../DialogBox/DialogBox';
import AsyncStorage from '@react-native-async-storage/async-storage';
import { fetchVisitors } from '../../../User/Redux/Slice/Security_Panel/InandOutSlice';
import { fetchCheckOut } from '../../../User/Redux/Slice/Security_Panel/CheckOutSlice';
import { Avatar } from 'react-native-paper'


const CheckOut = ({ data, setActiveTab }) => {

  const [responses, setResponses] = useState({});
  const dispatch = useDispatch();
  const [societyId, setSocietyId] = useState(null);
  const successMessage = useSelector(state => state.checkOuting.successMessage);
  const error = useSelector(state => state.checkOuting.error);
  const [showDialog, setShowDialog] = useState(false);

  useEffect(() => {
    const getSocietyId = async () => {
      try {
        const user = await AsyncStorage.getItem('user');
        const id = JSON.parse(user).societyId;
        if (id !== null) {
          setSocietyId(id);
        } else {
          console.error('No societyId found in AsyncStorage');
        }
      } catch (error) {
        console.error('Error fetching societyId from AsyncStorage:', error);
      }
    };
    getSocietyId();
  }, []);


  const renderItem = ({ item }) => {
    const response = responses[item._id];

    return (
      <View style={styles.itemContainer}>
        <View style={styles.imageContainer}>
          <Text style={styles.imageText}>{item.visitorId}</Text>
          {item.pictures ? (
            <Avatar.Image
              source={{ uri: `${ImagebaseURL}${item.pictures}` }}
              style={styles.avatar}
            />
          ) : (
            <Text style={styles.noImageText}>No Image</Text>
          )}
        </View>
        <View style={styles.itemTextContainer}>
          <Text style={styles.itemText}>{item.name}</Text>
          <Text style={styles.itemSubText}>{item.role}</Text>
          <Text style={styles.itemSubText}>{item.block}</Text>
          <Text style={styles.itemSubText}>{item.flatNo}</Text>
          <Text style={styles.itemSubText}>{item.phoneNumber}</Text>
        </View>
        <View style={styles.itemTextContainer}>
          <Text style={styles.itemSubText}>
            <Text style={{ fontWeight: 'bold', color: 'black' }}>Check In</Text>{'\n'}
            {new Date(item.checkInDateTime).toLocaleDateString()}{'\n'}{new Date(item.checkInDateTime).toLocaleTimeString()}
          </Text>
          <Text style={styles.itemSubText}>
            <Text style={{ fontWeight: 'bold', color: 'black' }}>Check Out</Text>{'\n'}
            {new Date(item.checkOutDateTime).toLocaleDateString()}{'\n'}{new Date(item.checkOutDateTime).toLocaleTimeString()}
          </Text>
        </View>
        <MyDialog
          message={successMessage || error}
          showDialog={showDialog}
          onClose={() => setShowDialog(false)}
        />
      </View>
    );
  };

  const sortedData = data.sort((a, b) => new Date(b.checkOutDateTime) - new Date(a.checkOutDateTime));

  return (
    <FlatList
      data={sortedData}
      renderItem={renderItem}
      keyExtractor={item => item._id}
      style={styles.list}
    />
  );
};

const styles = StyleSheet.create({
  itemContainer: {
    display: 'flex',
    borderBottomWidth: 1,
    borderBottomColor: '#eee',
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'space-between',
    padding: 5,
  },
  avatar: {
    width: 80,
    height: 80,
    borderRadius: 50,
    backgroundColor:"#ccc"

  },
  noImageText: {
    width: 80,
    height: 80,
    borderRadius: 50,
    marginTop: 25
  },
  imageContainer: {
    marginRight: 15,
    alignItems: 'center'
  },
  itemTextContainer: {
    flex: 1,
  },
  itemText: {
    fontSize: 15,
    fontWeight: '600',
  },
  itemSubText: {
    color: '#888',
  },
  imageText: {
    fontSize: 15,
    fontWeight: '600',
    color: '#800336',
    alignItems: 'center'
  },
  list: {
    paddingHorizontal: 15,
  },
  buttonContainer: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  button: {
    padding: 10,
    borderRadius: 5,
    marginLeft: 10,
    alignItems: 'center',
    justifyContent: 'center',
  },
  redButton: {
    backgroundColor: 'red',
    width: 70,
    height: 40,
  },
});

export default CheckOut;
